import styled from "styled-components";
import Dummy from "../img/past/10.jpg";
import Logo from "../img/mklogotp.png";

const MainContainer = styled.div``;

const Album = styled.ul`
  height: calc(400vh - 72vh);
`;

const Photo = styled.li``;

const IMGContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  align-items: center;
  width: 100vw;
  height: var(--mobile-screen);
  background-color: white;
  box-sizing: border-box;
`;

const RealIMG = styled.img`
  display: flex;
  justify-content: flex-start;
  align-items: flex-start;
  object-fit: contain;
  background-color: white;
  position: absolute;
  top: 2vh;
  width: 90vw;
`;

const IMGFrame = styled.div`
  width: 900px;
  height: 1600px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  position: relative;
`;

const LogoFrame = styled.div`
  display: flex;
  width: 100vw;
  height: calc(var(--mobile-screen) - 1600px);
`;

const LogoIMG = styled.img`
  object-fit: contain;
`;

function Main() {
  return (
    <>
      <MainContainer className="container">
        <Album className="unordered_lists">
          <Photo className="list">
            <IMGContainer>
              <IMGFrame>
                <RealIMG src={Dummy} />
              </IMGFrame>
              <LogoFrame>
                <LogoIMG />
              </LogoFrame>
            </IMGContainer>
          </Photo>
          <Photo className="list">
            <IMGContainer>
              <IMGFrame>
                <RealIMG src={Dummy} />
              </IMGFrame>
              <LogoFrame>
                <LogoIMG />
              </LogoFrame>
            </IMGContainer>
          </Photo>
          <Photo className="list">
            <IMGContainer>
              <IMGFrame>
                <RealIMG src={Dummy} />
              </IMGFrame>
              <LogoFrame>
                <LogoIMG />
              </LogoFrame>
            </IMGContainer>
          </Photo>
          <Photo className="list">
            <IMGContainer>
              <IMGFrame>
                <RealIMG src={Dummy} />
              </IMGFrame>
              <LogoFrame>
                <LogoIMG />
              </LogoFrame>
            </IMGContainer>
          </Photo>
        </Album>
      </MainContainer>
    </>
  );
}

export default Main;
